import React from "react";
import { Tile } from "../tile/Tile"

export const TileList = ({ appointments }) => {

  return (
    <div>
      {
        appointments.forEach(appointment => {
          <Tile
            name={appointment.name}
            description={appointment.description}
          />
        })
      }
    </div>
  );
};
